import React from 'react';

const BikeList = ({ bikes }) => {
  return (
    <div className="bike-list">
      <h2>Available Bikes</h2>
      <ul>
        {bikes.map((bike) => (
          <li key={bike.id}>
            {bike.name} - {bike.model} - ${bike.price}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default BikeList;
